import React from 'react'

const BiztoolCell = (props) => {
  return (
    <div>
      {props.type == 'text' &&
        <input
          type='text'
          className="column border border-primary"
          style={{
            width: `${props.width}px`,
            textAlign: `start`,
          }}
          onChange={e => props.onCellChange(props.type, props.address, e)}
          value={props.data}
        />}
      {props.type == 'money' &&
        <input
          type='money'
          className="column border border-primary"
          style={{
            width: `${props.width}px`,
            textAlign: `start`,
          }}
          onChange={e => props.onCellChange(props.type, props.address, e)}
          value={props.data}
        />}
      {props.type == 'number' &&
        <input
          type='number'
          className="column border border-primary"
          style={{
            width: `${props.width}px`,
            textAlign: `start`,
          }}
          onChange={e => props.onCellChange(props.type, props.address, e)}
          value={props.data}
        />}
      {props.type == 'date' &&
        <input
          type='date'
          className="column border border-primary"
          style={{
            width: `${props.width}px`,
            textAlign: `start`,
          }}
          onChange={e => props.onCellChange(props.type, props.address, e)}
          value={props.data}
        />}
      {props.type == 'asset-account-dropdown' &&
        <input
          type='text'
          className="column border border-primary"
          style={{
            width: `${props.width}px`,
            textAlign: `start`,
          }}
          onChange={e => props.onCellChange(props.type, props.address, e)}
          value={props.data}
        />}
    </div>
  )
}

export default BiztoolCell
